import React, { Component } from 'react';
import './App.css';
import { getAllStudents } from './client';
import { 
  Table
} from 'antd';

class App extends Component{

  state = {
    students: []
  }
  componentDidMount(){
    this.fetchStudents();
  }

  fetchStudents = () => {
    getAllStudents()
    .then(res => res.json()
    .then(students => {
      console.log(students);
      this.setState({
        students
      })
    }));
  }

  render(){

    const { students } = this.state;

   if(students && students.length ){

    const columns = [
      {
        title: 'StudentId',
        dataIndex: 'StudentId',
        key:'StudentId'
      },
      {
        title: 'First Name',
        dataIndex: 'firstName',
        key:'firstName'
      },
      {
        title: 'Last Name',
        dataIndex: 'lastName',
        key:'lastName'
      }

    ];

    return <Table dataSource = {students} columns = {columns} rowKey = 'studentId' />
   }
    return <h1>No Students Found</h1>
  }


}

export default App;
